svg.script:
(function(){
  var SPOUSE = {"P_att03": ["P_att04"], "P_att04": ["P_att03"], "P_hoc01": ["P_pol13"], "P_pol13": ["P_hoc01"], "P_cza35": ["P_cza36"], "P_cza36": ["P_cza35"], "P_geh09": ["P_att38"], "P_att38": ["P_geh09"], "P_pol11": ["P_polS03", "P_polS02"], "P_polS03": ["P_pol11"], "P_att05": ["P_att06"], "P_att06": ["P_att05"], "P_pol01": ["P_polS01"], "P_polS01": ["P_pol01"], "P_polS02": ["P_pol11"], "P_cza05": ["P_cza06"], "P_cza06": ["P_cza05"], "P_vlc01": ["P_pol12"], "P_pol12": ["P_vlc01"], "P_cza03": ["P_cza04"], "P_cza04": ["P_cza03"]};
  var FAMILY = {"M_attF1": ["P_att03", "P_att04", "P_pol08", "P_pol09", "P_pol10", "P_pol11", "P_att38", "P_att06"], "M_hocF1": ["P_hoc01", "P_pol13", "P_hoc02"], "M_czaF18": ["P_cza35", "P_cza36", "P_cza39", "P_cza37", "P_cza38", "P_cza40", "P_cza41", "P_cza42", "P_cza43", "P_cza44"], "M_gehF3": ["P_geh09", "P_att38", "P_geh01", "P_geh03"], "M_polF3": ["P_pol11", "P_polS03", "P_pol15", "P_pol16", "P_pol17", "P_pol18"], "M_attF2": ["P_att05", "P_att06", "P_att36", "P_att07"], "M_polF1": ["P_pol01", "P_polS01", "P_pol12", "P_pol13"], "M_polF2": ["P_pol11", "P_polS02", "P_pol14"], "M_czaF11": ["P_cza05", "P_cza06", "P_cza35", "P_cza03"], "M_vlcF1": ["P_vlc01", "P_pol12", "P_vlc02"], "M_czaF1": ["P_cza03", "P_cza04", "P_pol03", "P_pol04", "P_pol05", "P_pol06", "P_att03", "P_pol01", "P_pol07", "P_pol02"]};
  function clearHl(){ document.querySelectorAll('.blink').forEach(function(n){ n.classList.remove('blink'); n.classList.remove('highlight'); }); }
  function hl(id){ var el=document.getElementById(id); if(el){ el.classList.add('highlight'); el.classList.add('blink'); } }
  document.addEventListener('click', function(evt){
    var target = evt.target;
    var g = target.closest && target.closest('g[id^="P_"], g[id^="M_"]');
    if (!g) { while (target) { if (target.id && /^([PM]_)/.test(target.id) && target.tagName && target.tagName.toLowerCase() === 'g') { g = target; break; } target = target.parentNode; } }
    if (!g) return;
    var id = g.id; clearHl();
    if (/^P_/.test(id)) { (SPOUSE[id] || []).forEach(hl); }
    else if (/^M_/.test(id)) { hl(id); (FAMILY[id] || []).forEach(hl); }
  }, false);
})();
